      SELECT DISTINCT - ( 15 ) AS col0 FROM tab0 cor0 CROSS JOIN tab1 AS cor1 GROUP BY cor1.col0, cor0.col0, cor1.col2;
  - name: tab0
  - name: tab1

outputs:
  - name: q5639.out
    data: |
      -15
